import * as QL from 'shortql/graphql_cache.core';

function deleteEmptyProperty(object){
  for (var i in object) {
    var value = object[i];
    // console.log('typeof object[' + i + ']', (typeof value));
    if (!value) {
      delete object[i];
    }
    if(typeof value === 'string') {
      if(value == '') {
        delete object[i];
      }
    }
  }
  return object;
}

